(484, 'elementor_remote_info_feed_data', 'a:5:{i:0;a:5:{s:5:\"title\";s:74:\"2020 E-Commerce Holiday Readiness: 8 Tips for Preparing Your Online Store \";s:7:\"excerpt\";s:294:\"The holiday season offers an excellent opportunity for e-commerce websites to end the year with flying colors. It’s time to eat, drink and be merry and gather ‘round to share useful tips on preparing your online store for the holidays, and mark 2020 down as a year of online retail success.\";s:7:\"created\";i:1606472446;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:172:\"https://elementor.com/blog/2020-e-commerce-holiday-readiness-8-tips-for-preparing-your-online-store/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:55:\"Monthly Template Kits #15: The Travel Blog Template Kit\";s:7:\"excerpt\";s:215:\"This month\'s template kit is a travel blog, the kit itself takes you on a journey through the art of blogging — as our designers have created a bold and bright travel blog template kit for wanderlust enthusiasts. \";s:7:\"created\";i:1606300637;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:124:\"https://elementor.com/blog/travel-blog-template-kit/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:34:\"Elementor\'s Black Friday Sale 2020\";s:7:\"excerpt\";s:202:\"Our Black Friday and Cyber Monday 2020 promotion is our biggest sale of the year. Learn how easy it is to get the best rate possible for Elementor Pro and get the full ultimate web creation experience. \";s:7:\"created\";i:1606206495;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:117:\"https://elementor.com/blog/black-friday-2020/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:3;a:5:{s:5:\"title\";s:75:\"Form Design Best Practices: Takeaways From Our Webinar With Vitaly Friedman\";s:7:\"excerpt\";s:238:\"Designing the right forms for your site is challenging, but the benefits are worth it. In our webinar with the co-founder of Smash