INSERT INTO `wp_wc_admin_notes` (`note_id`, `name`, `type`, `locale`, `title`, `content`, `content_data`, `status`, `source`, `date_created`, `date_reminder`, `is_snoozable`, `layout`, `image`, `is_deleted`, `icon`) VALUES
(1, 'wc-admin-wc-helper-connection', 'info', 'en_US', 'Se connecter à WooCommerce.com', 'Connectez-vous pour obtenir des notifications et des mises à jour importantes sur les produits.', '{}', 'unactioned', 'woocommerce-admin', '2020-11-06 13:31:17', NULL, 0, 'plain', '', 0, 'info'),
(2, 'wc-admin-onboarding-profiler-reminder', 'update', 'en_US', 'Bienvenue dans WooCommerce ! Configurer votre boutique et commencer à vendre', 'Notre objectif est de vous aider tout au long des étapes les plus importantes du lancement de votre boutique.', '{}', 'actioned', 'woocommerce-admin', '2020-11-06 11:31:19', NULL, 0, 'plain', '', 0, 'info'),
(3, 'wc-admin-onboarding-email-marketing', 'info', 'en_US', 'Astuces, mises à jour des produits et inspiration', 'Nous sommes là pour vous, obtenir des astuces, mises à jour de produits et inspirations directement dans votre boîte e-mail', '{}', 'unactioned', 'woocommerce-admin', '2020-11-06 13:31:27', NULL, 0, 'plain', '', 0, 'info'),
(4, 'wc-admin-marketing-intro', 'info', 'en_US', 'Connectez-vous à votre audience', 'Faites croître votre base clients et augmentez vos ventes avec les outils marketing créés pour WooCommerce.', '{}', 'unactioned', 'woocommerce-admin', '2020-11-06 13:31:27', NULL, 0, 'plain', '', 0, 'info'),
(5, 'wc-admin-draw-attention', 'info', 'en_US', 'Comment attirer l’attention sur votre boutique en ligne', 'Pour vous lancer, voici sept façons de dynamiser vos ventes et d’éviter d’être noyé par des produits similaires fabriqués en série et en concurrence pour les mêmes acheteurs.', '{}', 'unactioned', 'woocommerce-admin', '2020-11-06 15:55:55', NULL, 0, 'plain', '', 0, 'info'),
(6, 'ecomm-need-help-setting-up-your-store', 'info', 'en_US', 'Need help setting up your Store?', 'Schedule a free 30-min <a href=\"https://wordpress.com/support/concierge-support/\">quick start session</a> and get help from our specialists. We’re happy to walk through setup steps, show you around the WordPress.com dashboard, troubleshoot any issues you may have, and help you the find the features you need to accomplish your goals for your site.', '{}', 'pending', 'woocommerce.com', '2020-11-06 15:57:11', NULL, 0, 'plain', '', 0, 'info'),
(7, 'woocommerce-services', 'info', 'en_US', 'WooCommerce Shipping & Tax', 'WooCommerce Shipping &amp; Tax helps get your store “ready to sell” as quickly as possible. You create your products. We take care of tax calculation, payment processing, and shipping label printing! Learn more about the extension that you just installed.', '{}', 'pending', 'woocommerce.com', '2020-11-06 15:57:11', NULL, 0, 'plain', '', 0, 'info'),
(8, 'ecomm-unique-shopping-experience', 'info', 'en_US', 'For a shopping experience as unique as your customers', 'Product Add-Ons allow your customers to personalize products while they’re shopping on your online store. No more follow-up email requests—customers get what they want, before they’re done checking out. Learn more about this extension that comes included in your plan.', '{}', 'pending', 'woocommerce.com', '2020-11-06 15:57:11', NULL, 0, 'plain', '', 0, 'info'),
(9, 'wc-admin-launch-checklist', 'info', 'en_US', 'Prêt à lancer votre boutique ?', 'Pour ne jamais ressentir cette sensation d’avoir oublié quelque chose, nous avons conçu une liste de contrôle reprenant les points essentiels avant lancement.', '{}', 'unactioned', 'woocommerce-admin', '2020-11-07 13:32:01', NULL, 0, 'plain', '', 0, 'info'),
(10, 'wc-admin-mobile-app', 'info', 'en_US', 'Installer l’application mobile Woo', 'Installez l’application mobile WooCommerce pour gérer les commandes, recevoir des notifications de vente et afficher les statistiques principales où que vous soyez.', '{}', 'unactioned', 'woocommerce-admin', '2020-11-09 12:28:54', NULL, 0, 'plain', '', 0, 'info'),
(11, 'wc-admin-online-clothing-store', 'info', 'en_US', 'Lancer votre boutique de vêtements en ligne', 'Lancer un site Web de mode est passionnant, mais peut sembler également accablant. Dans cet article, nous vous guiderons lors du processus de configuration, nous vous apprendrons à créer des listes de produits réussies et nous vous montrerons comment faire de la publicité auprès de votre public idéal.', '{}', 'unactioned', 'woocommerce-admin', '2020-11-09 12:28:54', NULL, 0, 'plain', '', 0, 'info'),
(12, 'wc-admin-onboarding-payments-reminder', 'info', 'en_US', 'Commencer à accepter les paiements sur votre boutique !', 'Accepter les paiements avec le fournisseur qui vous convient, parmi plus de 100 passerelles de paiement pour WooCommerce.', '{}', 'unactioned', 'woocommerce-admin', '2020-11-11 13:43:58', NULL, 0, 'plain', '', 0, 'info'),
(13, 'wc-admin-need-some-inspiration', 'info', 'en_US', 'Besoin d’inspiration ?', 'Découvrez quelques-uns de nos cas clients de notre communauté mondiale.', '{}', 'unactioned', 'woocommerce-admin', '2020-11-11 13:43:58', NULL, 0, 'plain', '', 0, 'info'),
(14, 'wc-admin-usage-tracking-opt-in', 'info', 'en_US', 'Aider WooCommerce à améliorer ses services grâce au suivi de l’utilisation', 'Gathering usage data allows us to improve WooCommerce. Your store will be considered as we evaluate new features, judge the quality of an update, or determine if an improvement makes sense. You can always visit the <a href=\"http://localhost:8090/doc-parent/monsite/wp-admin/admin.php?page=wc-settings&#038;tab=advanced&#038;section=woocommerce_com\" target=\"_blank\">Settings</a> and choose to stop sharing data. <a href=\"https://woocommerce.com/usage-tracking\" target=\"_blank\">Read more</a> about what data we collect.', '{}', 'unactioned', 'woocommerce-admin', '2020-11-13 13:33:10', NULL, 0, 'plain', '', 0, 'info'),
(15, 'wc-admin-store-notice-giving-feedback-2', 'info', 'en_US', 'Donner des commentaires', 'Maintenant que vous nous avez choisis comme partenaire, notre objectif est de nous assurer que nous vous fournissons les bons outils pour répondre à vos besoins. Nous sommes impatients de recevoir vos commentaires sur votre expérience de conception de la boutique pour que nous puissions l’améliorer à l’avenir.', '{}', 'unactioned', 'woocommerce-admin', '2020-11-14 13:31:31', NULL, 0, 'plain', '', 0, 'info'),
(16, 'wc-admin-insight-first-sale', 'survey', 'en_US', 'Le saviez-vous ?', 'Une boutique optimisée par WooCommerce nécessite en moyenne 31 jours pour réaliser sa première vente. Vous êtes sur la bonne voie ! Trouvez-vous ce type d’information utile ?', '{}', 'unactioned', 'woocommerce-admin', '2020-11-14 13:31:31', NULL, 0, 'plain', '', 0, 'info'),
(17, 'wc-admin-coupon-page-moved', 'update', 'en_US', 'La gestion des codes promo a changé d’emplacement !', 'Vous gérez désormais les codes promo dans Marketing &gt; Codes promo. Cliquez sur le bouton ci-dessous pour supprimer l’élément de menu hérité WooCommerce &gt; Codes promo.', '{}', 'unactioned', 'woocommerce-admin', '2020-11-16 06:13:41', NULL, 0, 'plain', '', 0, 'info'),
(18, 'wc-admin-home-screen-feedback', 'info', 'en_US', 'Aidez-nous à améliorer l’écran d’accueil de WooCommerce', 'Nous aimerions votre contribution pour concevoir ensemble l’écran d’accueil de WooCommerce. N’hésitez pas à partager vos commentaires, idées ou suggestions avec nous.', '{}', 'unactioned', 'woocommerce-admin', '2020-11-18 15:43:59', NULL, 0, 'plain', '', 0, 'info'),
(19, 'wc-admin-customize-store-with-blocks', 'info', 'en_US', 'Personnalisez votre boutique en ligne avec les blocs WooCommerce', 'Nos blocs vous permettent de sélectionner et d’afficher des produits, catégories, filtres et plus encore, pratiquement partout sur votre site. Pas besoin d’utiliser des codes courts ni de modifier des lignes de code. En savoir plus sur l’utilisation de chacun de ces blocs.', '{}', 'unactioned', 'woocommerce-admin', '2020-11-21 19:52:18', NULL, 0, 'plain', '', 0, 'info');
